import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="body">

     <input type="text" name="" id="Number"/>
     <input type="button" value="Random"/>
     <div>&lt;-</div>
     <img src="https://imgs.xkcd.com/comics/product_launch.png" alt="Comic"/>
     <div>-&gt;</div>
     <input type="button" value="Transcript"/>
    </div>
  );
}

export default App;
